import axios from 'axios';
import React from 'react'

class Products extends React.Component {
constructor(props){
    super(props)
    this.state = {}
}
renderUI = async (url) => {
    url = "https://60ae0d5e80a61f00173324bc.mockapi.io/products"
    let res = await axios.get(url);
    console.log(res.data)
    res.data.map(el =>{
        return (
            <div className="product-container">
            <img src={el.image} alt=""/>
            <p className="product-name">{el.name}</p>
            <p>{el.errorDescription}</p>
            <p>ID: <span>{el.id}</span></p>
            <p>Color : <span>{el.color}</span></p>
            <h3>SKU: <span>{el.sku}</span></h3> 
            </div>
            )
    })
}

      // 


    render(){
        return(
           <div>{this.renderUI()}</div>
        )
    }
}
export default Products
